@UN @WFP @UNICEF @UNDP @Refugees @FAO @UNRWA Since 2011, the EU enjoys enhanced observer status at the UN.
In New York, the EU delegation @EUatUN coordinates with all EU countries to ensure they speak with one voice.
It allows the EU to participate and present common positions at the UN’s general debate every September. https://t.co/3TJxbRuokM

@UN We are working with the @UN to eradicate hunger around the world.
The World Food Programme @WFP is the UN entity having received most EU funds, with over €920 million in 2018 alone.
Main funding commitments from 2013-2018 also went to @UNICEF, @UNDP, @Refugees, @FAO, @UNRWA https://t.co/L4KoylkYfK

@UN The EU is the largest development donor in the world.
In 2018, we provided over €74 billion in development assistance, aligned with the UN’s 2030 Agenda and its Sustainable Development Goals.
#GlobalGoals #ThisIsTheEU https://t.co/yNEiY9e24f

@UN Collectively, we are the UN’s largest financial contributor.
The EU and its member countries provide the UN with 30 % of its regular budget.
The European Commission alone contributed over €2.9 billion to support @UN external assistance programmes and projects in 2018. https://t.co/CRRsrZYqf0

